import React from 'react'

const BookCard = (props) => {
  return (
    <div className='bookcard'>
      <img src={props.book.img} alt='' />
      <div className='booktitle'>
        { props.book.title }
      </div>
      <div className='booktitle'>
        { props.book.author }
      </div>
    </div>
  )
}

export default BookCard;
